import { Container } from "react-bootstrap";
import {data} from "../api/data";
import Note from "./Note";

const ListNotes =()=> {

    return(
        <Container>
            {
                data.map(
                    (i, index)=>(
                      <Note data={i} index={index} />
                    )
                )
            }
        </Container>
    );
}

export default ListNotes;
